		if ($deep) {  // also de-associate any related objects?

			$this->collProfiles = null;
			$this->lastProfileCriteria = null;

			$this->collAgentHasUsers = null;
			$this->lastAgentHasUserCriteria = null;

			$this->collSchemas = null;
