	 * @param      boolean $deep Whether to also clear the references on all associated objects.
	 */
	public function clearAllReferences($deep = false)
	{
		if ($deep) {
			if ($this->collProfiles) {
				foreach ((array) $this->collProfiles as $o) {
					$o->clearAllReferences($deep);
				}
			}
			if ($this->collAgentHasUsers) {
				foreach ((array) $this->collAgentHasUsers as $o) {
					$o->clearAllReferences($deep);
				}
			}
			if ($this->collSchemas) {
				foreach ((array) $this->collSchemas as $o) {
					$o->clearAllReferences($deep);
				}
			}
			if ($this->collVocabularys) {
				foreach ((array) $this->collVocabularys as $o) {
					$o->clearAllReferences($deep);
				}
			}
		} // if ($deep)

		$this->collProfiles = null;
		$this->collAgentHasUsers = null;
		$this->collSchemas = null;
		$this->collVocabularys = null;
	}


  public function __call($method, $arguments)
  {
    if (!$callable = sfMixer::getCallable('BaseAgent:'.$method))
    {
      throw new sfException(sprintf('Call to undefined method BaseAgent::%s', $method));
    }

    array_unshift($arguments, $this);

    return call_user_func_array($callable, $arguments);
